import React, { useState } from 'react';

import {
  Container,
  RadioContainer,
  CheckContainer,
  NotCheckContainer,
  LabelText,
} from './styles';

interface Props {
  labelText?: string;
}

const InputRadio: React.FC<Props> = ({ labelText }) => {
  const [isChecked, setIsChecked] = useState(false);
  return (
    <Container>
      <RadioContainer onClick={() => setIsChecked(!isChecked)}>
        {isChecked ? <CheckContainer /> : <NotCheckContainer />}
      </RadioContainer>
      <LabelText>Yes</LabelText>
    </Container>
  );
};

export default InputRadio;
